import React, { useEffect, useRef, useState } from 'react';
import FormContainer from '../common/FormContailer';
import GetProduct from '../API/GetProducts';
import Select from '../common/Select';
import Seemore from '../common/Seemore';
import Breadcrumb from '../common/Breadcrumb';
import Dropdown from '../common/Dropdown';



const ContentProductPage = () => {

    const Arr = [
        { id: 1, name: "Ascending" },
        { id: 2, name: "Decrease" },
        { id: 3, name: "Hot" },
    ];
    const GenderArr = [
        { id: 1, name: "Male" },
        { id: 2, name: "Female" },
    ];
    const PriceRangeArr = [
        { id: 1, name: "Below $50" },
        { id: 2, name: "Above $50" },
    ];
    const SizeArr = [
        { id: 1, name: "XS (UK 4-6)" },
        { id: 2, name: "S (UK 8-10)" },
        { id: 3, name: "M (UK 12-14)" },
        { id: 4, name: "L (UK 12-14)" },
    ];
    const JerseyArr = [
        { id: 1, name: "Home" },
        { id: 2, name: "Away" },
        { id: 3, name: "Custom" },
    ];
    const FootballArr = [
        { id: 1, name: "FC Barcelona" },
        { id: 2, name: "AS Roma" },
        { id: 3, name: "Athletico Madrid" },
        { id: 4, name: "Paris Saint-Germain" },
    ];

    const [show, setShow] = useState(false);
    const [arrange, setArrange] = useState("Ascending");
    const RefDrop = useRef(null);

    const ChangeArrange = (value) => {
        setArrange(value)
        setShow(false);
    }

    useEffect(() => {
        const handleClick = (e) => {
            if (RefDrop.current && !RefDrop.current.contains(e.target)) {
                setShow(false);
            }
        };
        document.addEventListener("click", handleClick);
        return () => {
            document.removeEventListener("click", handleClick);
        };
    }, []);

    const Click = () => ChangeArrange(arrange)
    return (
        <FormContainer className='pt-10'>
            <div className='flex justify-between'>
                <div>
                    <Breadcrumb></Breadcrumb>
                    <h1 className='text-3xl font-bold '>Women's Jerseys</h1>
                </div>
                <div className='relative' ref={RefDrop}>
                    <Dropdown onClick={Click} data={Arr} table={arrange} status={false} classNameTable={"font-medium text-2xl mr-4 w-[100px] "}></Dropdown>
                    {/* <div
                        className="flex items-center justify-center w-full p-5 border border-gray-400 cursor-pointer"
                        onClick={() => {
                            setShow(!show);
                        }}>
                        <h3 className='font-normal text-base mr-4 w-[100px]'>{arrange}</h3>

                    </div> */}
                </div>
            </div>
            <div className='grid grid-cols-3 gap-4 mt-10'>
                <div className='col-span-1 sidebar'>
                    <Select className='select-gender' >
                        <Dropdown className=' w-[230px]  ' classNameTable={"font-medium text-2xl w-full "} data={GenderArr} table={"Gender"}></Dropdown>
                    </Select>
                    <Select className='select-price' >
                        <Dropdown className=' w-[230px]' classNameTable={"font-medium text-2xl w-full "} data={PriceRangeArr} table={"Price Range"} ></Dropdown>
                    </Select>
                    <Select className='select-size' >
                        <Dropdown className=' w-[230px]' classNameTable={"font-medium text-2xl w-full "} data={SizeArr} table={"Size"}></Dropdown>
                    </Select>
                    <Select className='select-football' >
                        <Dropdown className=' w-[230px]' classNameTable={"font-medium text-2xl w-full "} data={FootballArr} table={"Football Team"} ></Dropdown>
                    </Select>
                    <Select className='select-type' >
                        <Dropdown className=' w-[230px]' classNameTable={"font-medium text-2xl w-full "} data={JerseyArr} table={"Jersey Type"} ></Dropdown>
                    </Select>
                </div>
                <div className='col-span-2'>
                    <GetProduct className='grid-cols-3 gap-x-5 gap-y-10'></GetProduct>
                    <Seemore to='/products-new-in' className='flex items-center justify-center p-3 border-solid border-2 border-[#DEDEDE] font-medium rounded-lg cursor-pointer my-10' > Load More Products</Seemore>
                </div>
            </div>
        </FormContainer>

    );
};

export default ContentProductPage;
